from flask import render_template, redirect, url_for
from forms.SignupForm import SignupForm
from forms.AddProductForm import AddProductForm
from ext import app

products = [
    {"name": "kitri", "price": 3, "image": "data:image/jpeg;base64,"},
    {"name": "kitri", "price": 4, "image": "data:image/jpeg;base64,"},
    {"name": "kitri", "price": 2, "image": "data:image/jpeg;base64,"},
    {"name": "niori", "price": 5, "image": "data:image/jpeg;base64,"},
    {"name": "xaxvi", "price": 7, "image": "data:image/jpeg;base64,"},
    {"name": "asorti", "price": 15, "image": "data:image/jpeg;base64,"}
]


@app.route("/", methods=['GET', 'POST'])
def home():
    return render_template("home.html", products=products)


@app.route('/signup', methods=['GET', 'POST'])
def signup():
    signup_form = SignupForm()
    if signup_form.validate_on_submit():
        return redirect(url_for('home'))
    return render_template('signup.html', signup_form=signup_form)


@app.route('/addProduct', methods=['GET', 'POST'])
def add_product():
    add_product_form = AddProductForm()
    if add_product_form.validate_on_submit():
        return redirect(url_for('home'))
    return render_template('add_product.html', add_product_form=add_product_form)
